export function RetrieveApiData(setSymbols:any){
    async function retrieveData(){
        const url:string = 'https://finnhub.io/api/v1/stock/symbol?exchange=US&token=bueubhn48v6tiubsufc0'
        return await fetch(url);
    }
    
    async function processRetrievedData(){
        return retrieveData().then(resp => resp.json())
        .then(data => {
            let symbolObjects:Array<any> = [];
            for(let i=0;i<data.length;i++){
                symbolObjects.push({symbol:data[i].symbol,description:data[i].description});
            }
            setSymbols(symbolObjects);
        });
    }

    retrieveData();
}
